#include <iostream>


using namespace std;


template<typename T>
class Vector {

public:
	Vector() : size_(0), capacity_(4), arr_(new T[4]) {}

	explicit Vector(const int vector_capacity) : size_(0), capacity_(vector_capacity), arr_(new T[vector_capacity]) {}

	Vector(const initializer_list<T>& list) : size_(list.size()), capacity_(list.size()), arr_(new T[list.size()]) {
		int i = 0;
		for (const T& element : list) {
			arr_[i] = element;
			i++;
		}
	}

	Vector(const Vector& other) : size_(other.size_), capacity_(other.capacity_), arr_(new T[capacity_]) {
		for (int i = 0; i < size_; i++) {
			arr_[i] = other.arr_[i];
		}
		total_number_elements_ += size_;
	} // конструктор копирования

	Vector& operator=(const Vector& other) {
		if (&other != this) { // проверка на самоприсваивание
			total_number_elements_ += other.size_ - size_; // общее количество увеличивается (уменьшается) на разность элементов
			size_ = other.size_;
			capacity_ = other.capacity_;
			delete[] arr_;
			arr_ = new T[capacity_];
			for (int i = 0; i < size_; i++) {
				arr_[i] = other.arr_[i];
			}
		}
		return *this;
	} // копирующий оператор присваивания =

	Vector(Vector&& other) : size_(other.size_), capacity_(other.capacity_), arr_(other.arr_) {
		other.arr_ = nullptr;
		other.size_ = 0;
		other.capacity_ = 0;
	} // конструктор перемещения

	Vector& operator=(Vector&& other) {
		if (&other != this) {
			total_number_elements_ += other.size_ - size_; // общее количество увеличивается (уменьшается) на разность элементов
			size_ = other.size_;
			capacity_ = other.capacity_;
			delete[] arr_;
			arr_ = other.arr_;
			other.arr_ = nullptr;
			other.size_ = 0;
			other.capacity_ = 0;
		}
		return *this;
	} // перемещающий оператор присваивания =

	void push_back(const T value) {
		check_capacity();
		arr_[size_] = value;
		size_++;
		total_number_elements_++;
	}

	void pop_back() {
		if (size_ > 0) {
			size_--;
		}
		total_number_elements_--;
	}

	void insert(const int index, const T value) {
		if (index < 0 || index > size_) {
			cout << "Некорректный индекс" << endl;
			return;
		}
		check_capacity();
		for (int i = size_; i > index; i--) {
			arr_[i] = arr_[i - 1];
		}
		arr_[index] = value;
		size_++;
		total_number_elements_++;
	}

	void erase(const int index) {
		if (index < 0 || index >= size_) {
			cout << "Некорректный индекс" << endl;
			return;
		}
		for (int i = index; i < size_ - 1; i++) {
			arr_[i] = arr_[i + 1];
		}
		size_--;
		total_number_elements_--;
	}

	T& operator[](const int index) {
		if (index < 0 || index >= size_) {
			cout << "Некорректный индекс" << endl;
		}
		return arr_[index];
	}

	T operator[](const int index) const {
		if (index < 0 || index >= size_) {
			cout << "Некорректный индекс" << endl;
		}
		return arr_[index];
	}

	int size() const {
		return size_;
	}

	int capacity() const {
		return capacity_;
	}

	bool operator==(const Vector& right) const {
		if (right.size_ != size_) {
			return false;
		}
		for (int i = 0; i < size_; i++) {
			if (arr_[i] != right.arr_[i])
				return false;
		}
		return true;
	}

	bool operator!=(const Vector& right) const {
		return !(*this == right);
	}

	void print() const {
		for (int i = 0; i < size_; i++) {
			cout << arr_[i] << " ";
		}
		cout << endl;
	}

	static int get_total_number_elements() {
		return total_number_elements_;
	}


	~Vector() {
		delete[] arr_;
		total_number_elements_ -= size_;
	}

private:

	void check_capacity() {
		if (size_ == capacity_) {
			T* temp = new T[capacity_ * 2];
			for (int i = 0; i < size_; i++) {
				temp[i] = arr_[i];
			}
			delete[] arr_;
			arr_ = temp;
			capacity_ *= 2;
		}
	}

	int size_; // текущее количество элементов
	int capacity_; // емкость хранилища
	T* arr_; // хранилище
	static int total_number_elements_; // общее количество элементов по всем векторам
};


int Vector<int>::total_number_elements_ = 0;
int Vector<string>::total_number_elements_ = 0;


int main() {
	setlocale(LC_ALL, "ru");

	Vector<int> vec1;

	vec1.push_back(10);
	vec1.push_back(15);
	vec1.push_back(20);
	vec1.push_back(25);
	vec1.push_back(22);

	vec1.print();

	vec1.pop_back();
	vec1.print();

	vec1.insert(2, 44);
	vec1.print();

	vec1.erase(2);
	vec1.print();

	vec1[0] = 33;
	cout << vec1[3] << endl;

	vec1.print();

	cout << vec1.size() << endl;
	cout << vec1.capacity() << endl;

	cout << Vector<int>::get_total_number_elements() << endl;

	const Vector<int> vec2(vec1);

	vec2.print();

	cout << vec2.size() << endl;
	cout << vec2.capacity() << endl;

	Vector<int> vec3;
	vec3 = vec1;

	cout << Vector<int>::get_total_number_elements() << endl;

	cout << (vec1 == vec2) << endl;
	cout << (vec1 != vec2) << endl;

	Vector<string> vec4{ "один", "два", "три" };
	vec4.print();
}

#include <iostream>
#include <string>

using namespace std;

template<typename T>
class SimpleVector {

public:

	SimpleVector() : arr_(new T[10]), size_(10) {}

	SimpleVector(int size) : arr_(new T[size]), size_(size) {}

	SimpleVector(const initializer_list<T>& list) : arr_(new T[list.size()]), size_(list.size()) {
		int i = 0;
		for (const T& element : list) {
			arr_[i] = element;
			i++;
		}
	}

	SimpleVector(const SimpleVector& object) : arr_(new T[object.size_]{}), size_(object.size_) {
		for (int i = 0; i < size_; i++) {
			arr_[i] = object.arr_[i];
		};
	}

	SimpleVector& operator=(const SimpleVector& object) {
		if (!(this == &object)) {
			delete[] arr_;
			arr_ = new T[object.size_];
			size_ = object.size_;
			for (int i = 0; i < size_; i++) {
				arr_[i] = object.arr_[i];
			}
		}
		return *this;
	}

	SimpleVector(SimpleVector&& object) : arr_(object.arr_), size_(object.size_) {
		object.arr_ = nullptr;
		object.size_ = 0;
	}

	SimpleVector& operator=(SimpleVector&& object) {
		if (!(this == &object)) {
			delete[] arr_;
			arr_ = object.arr_;
			size_ = object.size_;
			object.arr_ = nullptr;
			object.size_ = 0;
		}
		return *this;
	}

	T& operator[] (int index) {
		if (index >= 0 && index < size_) {
			return arr_[index];
		}
	}

	T operator[] (int index) const {
		if (index >= 0 && index < size_) {
			return arr_[index];
		}
	}

	int Size() const {
		return size_;
	}

	~SimpleVector() {
		delete[] arr_;
	}

private:
	T* arr_;
	int size_;
};

template<typename T>
void print(const SimpleVector<T>& vec) {
	for (int i = 0; i < vec.Size(); i++) {
		cout << vec[i] << " ";
	}
	cout << endl;
}

template<typename T>
void sort(SimpleVector<T>& vec) {
	for (int i = 0; i < vec.Size(); i++) {
		for (int j = 0; j < vec.Size() - 1; j++) {
			if (vec[j] > vec[j + 1]) {
				T temp = vec[j];
				vec[j] = vec[j + 1];
				vec[j + 1] = temp;
			}
		}
	}
}

int main() {
	SimpleVector<int> vec;
	for (int i = 0; i < vec.Size(); i++) {
		vec[i] = rand() % 10;
	}
	for (int i = 0; i < vec.Size(); i++) {
		cout << vec[i] << " ";
	}
	cout << endl;

	SimpleVector<int> IntVector;
	for (int i = 0; i < IntVector.Size(); i++) {
		IntVector[i] = rand() % 10;
	}
	cout << "IntVector:" << endl;
	print(IntVector);
	cout << endl;
	cout << "Sorted IntVector:" << endl;
	sort(IntVector);
	print(IntVector);
	cout << endl;

	SimpleVector<string> StringVector;
	StringVector[0] = "two";
	StringVector[1] = "seven";
	StringVector[2] = "zero";
	StringVector[3] = "four";
	StringVector[4] = "one";
	StringVector[5] = "three";
	StringVector[6] = "five";
	StringVector[7] = "six";
	StringVector[8] = "eight";
	StringVector[9] = "nine";
	cout << "StringVector:" << endl;
	print(StringVector);
	cout << endl;
	cout << "Sorted StringVector:" << endl;
	sort(StringVector);
	print(StringVector);
	cout << endl;

	SimpleVector<int> IntVector2{ 3,5,2,7,9,1,4 };
	sort(IntVector2);
	print(IntVector2);

	SimpleVector<char> CharVector{ 'a','v','b','w','c'};
	sort(CharVector);
	print(CharVector);
}

import { CommonModule } from '@angular/common';
import { Component, OnInit } from '@angular/core';
import { FormArray, FormBuilder, FormGroup, ReactiveFormsModule, Validators } from '@angular/forms';
import { ApiService } from '../services/api.service';

@Component({
  selector: 'app-create-page',
  templateUrl: './create-page.component.html',
  styleUrls: ['./create-page.component.css'],
  standalone: true,
  imports: [ReactiveFormsModule, CommonModule]
})
export class CreatePageComponent implements OnInit {
  createForm!: FormGroup;
  imagePreview: string | ArrayBuffer = '';
  currentFormSection = 1; 
  totalFormSections = 4;
  imagesPreview: string[] = []; 
  dayImages: { previews: string[] }[] = [];
  currentDayIndex: number = 0; 


  constructor(private fb: FormBuilder, private apiService:ApiService) { }

  ngOnInit() {
    this.createForm = this.fb.group({
      image: [null],
      title: ['', Validators.required],
      paragraph: ['', Validators.required],
      "title-desc": ['', Validators.required],
      'info-desc': ['', Validators.required],
      'images': [null] ,
      dateRange: this.fb.group({
        start: ['', Validators.required],
        end: ['', Validators.required]
      }),
      price: ['', [Validators.required, Validators.pattern(/^\d+$/)]],
      conditions: this.fb.group({
        ticketsIncluded: [false],
        allTransportCosts: [false],
        accommodations: [false],
        allMeals: [false],
        practices: [false],
        atvTour: [false],
        spaAccess: [false],
        guidesIncluded: [false],
        medicalInsurance: [false],
        personalExpenses: [false],
        alcoholicBeverages: [false],
        unspecifiedServices: [false],
        additionalActivitiesFee: [false],
        cancellationInsurance: [false]
      }),
      days: this.fb.array([this.initDayForm()]),
      
      });
      this.dayImages.push({ previews: [] });
      console.log('fs',this.createForm.value)
  }
  initDayForm(): FormGroup {
    return this.fb.group({
      dayImage: [null],
      dayTitle: ['', Validators.required],
      dayInfo: ['', Validators.required]
    });
  };
  goToDay(index: number) {
    this.currentDayIndex = index;
  }

  addDay() {
    const days = this.createForm.get('days') as FormArray;
    const newDayFormGroup = this.initDayForm();
    days.push(newDayFormGroup);
   
    this.currentDayIndex = days.length - 1;
  };

  // Функция за премахване на ден
  removeDay(index: number) {
    const days = this.createForm.get('days') as FormArray;
    if (days.length > 1) {
      days.removeAt(index);
      this.dayImages.splice(index, 1); // Премахваме снимките за деня
    }
  };
  nextDay() {
    if (this.currentDayIndex < this.days.length - 1) {
      this.currentDayIndex++;
    }
  }

  previousDay() {
    if (this.currentDayIndex > 0) {
      this.currentDayIndex--;
    }
  }
    // Функция за получаване на дните като FormArray
    get days(): FormArray {
      return this.createForm.get('days') as FormArray;
    }
  onImageChange(event: Event) {
    const file = (event.target as HTMLInputElement).files?.[0];
    if (file) {
      const reader = new FileReader();
      reader.onload = () => {
        this.imagePreview = reader.result!;
      };
      reader.readAsDataURL(file);
    }
  }
  onImagesChange(event: Event) {
    const files = (event.target as HTMLInputElement).files;
    this.imagesPreview = []; 
    if (files && files.length <= 4) {
      Array.from(files).forEach(file => {
        const reader = new FileReader();
        reader.onload = () => {
          this.imagesPreview.push(reader.result as string);
        };
        reader.readAsDataURL(file);
      });
    } else {

      console.error("Можете да качите максимум 4 снимки.");
    }
  };
  onDayImageChange(event: Event, dayIndex: number) {
    const files = (event.target as HTMLInputElement).files;
    if (files) {
      this.dayImages[dayIndex].previews = []; 
      Array.from(files).forEach(file => {
        const reader = new FileReader();
        reader.onload = () => {
          
          this.dayImages[dayIndex].previews.push(reader.result as string);
        };
        reader.readAsDataURL(file);
      });
    }
  }
  onSubmit() {
  
    if (this.createForm.valid) {
      const formData = {
        ...this.createForm.value,
        image: this.imagePreview,
        images: this.imagesPreview,
        days: this.days.value.map((day: any, index: number) => {
     
          const dayImageObj = this.dayImages[index];
          return {
            ...day,
            dayImage: dayImageObj ? dayImageObj.previews : []
          };
        })
      };
  
  
      this.apiService.createDestination(formData).subscribe({
        next: (response) => {
          console.log('Destination created successfully', response);
   
        },
        error: (error) => {
          console.error('Error creating destination', error);
   
        }
      });
    } else {
      console.log('Form is not valid');

    }
  }
  
  goToNextSection() {
    if(this.currentFormSection < this.totalFormSections) {
      this.currentFormSection++;
    }
  
  }

  goToPreviousSection() {
    if(this.currentFormSection > 1) {
      this.currentFormSection--;
    }
  
  }
}

int echoPinTyl = 36;
int trigPinTyl = 26;
int echoPinPrzod = 40;
int trigPinPrzod = 46;

int odlegloscTyl= -1;
int distanceTyl= -1;
int odlegloscPrzod = -1;
int distancePrzod = -1;


void setup() {
  // put your setup code here, to run once:

   Serial.begin(115200);
   Serial.println("\n<Arduino is ready>");

   pinMode(echoPinTyl, INPUT);
   pinMode(trigPinTyl, OUTPUT);  

   pinMode(echoPinPrzod, INPUT);
   pinMode(trigPinPrzod, OUTPUT);

}

void loop() {

  
  odlegloscPrzod = odczytOdleglosciPrzod();
  Serial.println("Przod: "+(String)odlegloscPrzod+" cm");


  delay(1000);

}

int odczytOdleglosciPrzod()
{
  digitalWrite(trigPinPrzod, HIGH);
  delay(10);
  digitalWrite(trigPinPrzod, LOW);
  distancePrzod = pulseIn(echoPinPrzod, HIGH);
  return distancePrzod/59;
}

