#include<bits/stdc++.h>
#define int long long

using namespace std;

void solve(int t) {
	int q; cin >> q;
	int l = 1, r = q, count, a, n, mid;
	while(l <= r) {
		count = 0, a = 5;
		mid = (l + r) >> 1;
		n = mid * 5;
		while(1) {
			count += n / a;
			a *= 5;
			if (n / a == 0) break;
		}
		if (count == q) break;
		else if (count < q) l = mid + 1;
		else r = mid - 1;
	}
	if (count == q) {
		cout << "Case " << t << ": " << n << "\n";
	} else cout << "Case " << t << ": impossible\n";
}

