using namespace std;
const int di[] = {-1, 1, 0, 0};
const int dj[] = {0, 0, -1, 1};
int n, m;
char mat[55][55];
int dist[55][55][55][55];
struct node {
    int ci, cj;
    int time, money;
    node (){}
    node(int _ci, int _cj, int _time, int _money) {
        ci = _ci;
        cj = _cj;
        time = _time;
        money = _money;
    }
    bool operator < (const node &tmp) const {
        if(money == tmp.money) {
            return time > tmp.time;
        }
        return money > tmp.money;
    }
};
void bfs() {
    for(int i = 0; i < n; i++) {
        for(int j = 0; j < m; j++) {
            if(mat[i][j] == 'M') {
                vector<vector<bool>> visited(n, vector<bool>(m, false));
                visited[i][j] = true;
                queue<int> q;
                q.push(i);
                q.push(j);
                q.push(0);
                
                while(!q.empty()) {
                    int ci = q.front(); q.pop();
                    int cj = q.front(); q.pop();
                    int cekor = q.front(); q.pop();
                    dist[i][j][ci][cj] = cekor;
                    
                    for(int k = 0; k < 4; k++) {
                        int ti = ci + di[k];
                        int tj = cj + dj[k];
                        if(ti >= 0 and ti < n and tj >= 0 and tj < m and !visited[ti][tj]) {
                            q.push(ti);
                            q.push(tj);
                            q.push(cekor + 1);
                            visited[ti][tj] = true;
                        }
                    }
                }
            }
        }
    }
}
int dp[55][55][555];
int main() {
    ios_base::sync_with_stdio(false);
    int t, M;
    cin >> n >> m >> M >> t;
    int si, sj, ei, ej;
    vector<pair<int, int>> metro;
    for(int i = 0; i < n; i++) {
        for(int j = 0; j < m; j++) {
            cin >> mat[i][j];
            if(mat[i][j] == 'T') {
                si = i;
                sj = j;
            }
            if(mat[i][j] == 'K') {
                ei = i;
                ej = j;
            }
            if(mat[i][j] == 'M') {
                metro.push_back(make_pair(i, j));
            }
        }
    }
    bfs();
    for(int i = 0; i < 55; i++){
        for(int j =0 ; j < 55; j++) {
            for(int k = 0; k < 555;k ++) {
                dp[i][j][k] = 2e9;
            }
        }
    }
    priority_queue<node> pq;
    pq.push(node(si, sj, 0, 0));
    
    while(!pq.empty()) {
        node c = pq.top(); pq.pop();
        
        if(c.ci == ei and c.cj == ej) {
            cout << c.money << endl;
            return 0;
        }
        if(mat[c.ci][c.cj] == 'M') {
            for(pair<int, int> p : metro) {
                int d = dist[c.ci][c.cj][p.first][p.second];
                if(c.time + d <= t and c.money + 5 * d < dp[p.first][p.second][c.time + d]) {
                    pq.push(node(p.first, p.second, c.time + d, c.money + 5 * d));
                    dp[p.first][p.second][c.time + d] = c.money + 5 * d;
                }
            }
        }
        
        for(int i = 0; i < 4; i++) {
            int ti = c.ci + di[i];
            int tj = c.cj + dj[i];
            if(ti >= 0 and ti < n and tj >= 0 and tj < m and mat[ti][tj] != '#') {
                if(c.time + 5 <= t and c.money < dp[ti][tj][c.time + 5]) {
                    pq.push(node(ti, tj, c.time + 5, c.money));
                    dp[ti][tj][c.time + 5] = c.money;
                }
                if(c.time + 2 <= t and c.money + 1 < dp[ti][tj][c.time + 2]) {
                    pq.push(node(ti, tj, c.time + 2, c.money + 1));
                    dp[ti][tj][c.time + 2] = c.money + 1;
                }
            }
        }
        
    }
    cout << -1 << endl;
    return 0;
}

#include <iostream>
#include <map>
#include <vector>
using namespace std;
int n, m;
int mat[55][55];
map<pair<vector<int>,int >, int> dp;
int rec(vector<int> idx, int at) {
    if(dp.count(make_pair(idx, at))) {
        return dp[make_pair(idx, at)];
    }
    int res = 0;
    for(int j = at + 1; j < m; j++) {
        int sum = 0;
        bool ok = true;
        for(int i = 0; i < idx.size(); i++) {
            if(mat[idx[i]][at] > mat[idx[i]][j]) {
                ok = false;
                break;
            }
            sum += mat[idx[i]][j];
        }
        if(ok) {
            res = max(res, rec(idx, j) + sum);
        }
    }
    return dp[make_pair(idx, at)] = res;
}
int main() {
    ios_base::sync_with_stdio(false);
    int k;
    cin >>n >> m >> k;
    
    for(int i = 0; i < n; i++) {
        for(int j = 0; j < m; j++) {
            cin >> mat[i][j];
        }
    }
    int res = 0;
    vector<int> v_res;
    for(int bitmask = 0; bitmask < (1 << n); bitmask++) {
        if(__builtin_popcount(bitmask) != k) continue;
        vector<int> idx;
        for(int i = 0; i < n; i++) {
            if(bitmask & (1 << i)) {
                idx.push_back(i);
            }
        }
        
        for(int j = 0; j < m; j++) {
            int sum = 0;
            for(int k = 0; k < idx.size(); k++) {
                sum += mat[idx[k]][j];
            }
            int tmp = rec(idx, j) + sum;
            if(tmp > res) {
                res = tmp;
                v_res = idx;
            }
            else if(tmp == res) {
                v_res = min(v_res, idx);
            }
        }
    }
    cout << res << endl;
    for(int i = 0; i < v_res.size(); i++) {
        cout << v_res[i] + 1 << " " ;
    }
    return 0;
}

